import React from 'react';

class Case extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      color: "white"
    }
  }
  render() {
    return (
      <div className={"rond"+props.aorb}>
      </div>
    );
  }
}

export default Case;
